export default function Main() {
  
  let list = [
    {productName: 'Shoes', price: 100, url: 'imageurl'},
    {productName: 'Jacket', price: 200},
    {productName: 'Xyz', price: 150},
    {productName: 'Shirt', price: 190},
    {productName: 'Shirt', price: 190},
    {productName: 'Shirt', price: 190},
    {productName: 'Shirt', price: 190},
  ]

  return (
    <div className='container d-flex flex-wrap gap-3 mt-4'>
      {
        list.map((product) => { 
          <div class="card" style={{width:'300px'}}>
            <img class="card-img-top" src="https://via.placeholder.com/300" alt="Title" />
            <div class="card-body">
              <h4 class="card-title">{product.productName}</h4>
              <p class="card-text">{product.price}</p>
            </div>
          </div>
})
      }
    </div>
  )
}
